import React from "react";

function Food({ name, image }) {
  return (
    <div>
      <h2>I like {name}</h2>
      <img src={image} />
    </div>
  );
}

const foodILike = [
  {
    id: 1,
    name: "Kimchi",
    image:
      "https://health.chosun.com/site/data/img_dir/2020/07/21/2020072103114_0.jpg",
  },
  {
    id: 2,
    name: "ramen",
    image:
      "data:image/jpeg;base64,",
  },
  {
    id: 3,
    name: "samgyupsal",
    image:
      "data:image/jpeg;base64,",
  },
  {
    id: 4,
    name: "spagetti",
    image:
      "data:image/jpeg;base64,",
  },
];

function App() {
  return (
    <div>
      {foodILike.map((dish) => (
        <Food key={dish.id} name={dish.name} image={dish.image} />
      ))}
    </div>
  );
}

export default App;
